import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';
import Header from './Header'
import './styles.scss';
import PageTitle from './PageTitle';


const Components = () => (
  <>
  <Header />
  <PageTitle title="Components"></PageTitle>

  <div class="compWrapper">
    <div class="compBlock">
    <Link className="nav__link" to="/comp-docs/PageTitleDoc">Components</Link>
    </div>
  </div>
  </>
)

export default Components;
